   [249]={next_id=250, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="《克罗瓦德假日谈》，一部年纪比你还要大的老电影，胶片的颗粒质感与蹩脚的译制腔充分昭示着它的年代。\n电影的主角是一位财阀家的小姐，在某次度假时遭遇意外，被迫与家人一起滞留克罗瓦德后发生的故事。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_104.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, page_show_effect={ 0.20, 0, 5, 0, 0.00, 0.00, 0.00, 0.00, 863.00, 291.00, 1.00, {}, {}}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [250]={next_id=251, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="“妈妈，我们什么时候回家呢？我们要在这里呆到什么时候呢？”\n温柔的母亲交给她一把种子。\n“我的女儿，等你把这片花圃种满丁香花，就是我们回家的时候。”", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_104.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, page_show_effect={ 0.20, 0, 5, 0, 0.00, 0.00, 0.00, 0.00, 1063.00, 291.00, 1.00, {}, {}}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [251]={next_id=252, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="即便是最明媚的春日，这座花园也只有葱葱绿意，从来没有她所期望的那抹紫色。\n克罗瓦德的泥土并不适合这种娇贵的花朵生长，炒制过的种子永远不可能开花，所有人不约而同地隐瞒了这一事实，然后以鼓励与赞美为她编织了美好的谎言。\n若干年后，贫瘠的庄园满目葱茏，百花绽放。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_104.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, page_show_effect={ 0.20, 0, 5, 0, 0.00, 0.00, 0.00, 0.00, 863.00, 291.00, 1.00, {}, {}}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [252]={next_id=253, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="谁都赞叹园丁的勤劳与巧思，旧友从故乡而来，为园丁带了一束丁香花。\n“我的老友，我早已看清了自己的过去与未来。”", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_104.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, page_show_effect={ 0.20, 0, 5, 0, 0.00, 0.00, 0.00, 0.00, 1063.00, 291.00, 1.00, {}, {}}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
